(25, 8, 'Washer / Dryer', '', '100', '{\"title\":\"Acclaimed Premium Coverage Upgrade $75\",\"subtitle\":\"(40 Additional Items included plans Premium, Premium +, Premium +1, & Ultimate)\",\"full_content\":\"<p>Covered: This coverage upgrade option provides coverage for the following items that are normally excluded from the Standard Coverage plan.</p><p><strong><b>Heating System</b></strong>: registers- disposable filters - grills - heat lamps </p><p><strong><b>Plumbing</b></strong>: angle stop and gate ball valves - toilet replacement with like kind and quality up to $400 per occurrence - interior hose bibs - shower heads - shower arms - faucets (replaced with chrome builder standard when necessary) </p><p><strong><b>Air Conditioner</b></strong>: Freon recovery, recapture and recharge up to $20 per lb. (not included in Tune Up service) - window units - registers </p><p><strong><b>Refrigerator</b></strong> (with purchase of coverage): Freon recovery, recapture and recharge - ice maker. In cases where parts are not available, our obligation is limited to cash in lieu based on replacement cost of the ice maker </p><p><strong><b>Dishwasher</b></strong>: rollers - baskets - racks - dials - door seals - hinges </p><p><strong><b>Water Heater</b></strong>: failures due to sediment </p><p><strong><b>Electrical</b></strong>: attic fans </p><p><strong><b>Trash Compactor</b></strong>: key assemblies - locks - removable bucket </p><p><strong><b>Garage Door Opener</b></strong>: springs - hinges - remote transmitter - keypad </p><p><strong><b>Oven/Range Cooktop</b></strong>: racks - clocks - rotisseries - knobs - dials - handles - interior lining </p><p><strong><b>Built in Microwave Oven</b></strong>: interior lining - shelves – clock</p>\"}', '<span><a>Premium Coverage Upgrade</a>'),
(26, 8, 'Water Softener', '', '75', '', ''),
(27, 8, 'Casita / Guest House', '', '195', '{\"title\":\"No Fault Coverage $60\",\"subtitle\":\"\",\"full_content\":\"<p>Covered: This coverage option provides coverage for failures due to mismatched systems, improper installations, code violations, crane costs, haul away service for systems or appliances that have failed, as set forth hereafter.</p><p><strong><b>Mismatched Systems</b></strong>: AHW will repair or replace a system or appliance that has failed due to a mismatch in capacity or efficiency provided the system is not undersized relative to the square footage of the area being cooled and/or heated </p><p><strong><b>Improper Installation</b></strong>: AHW will replace or repair a covered item that was improperly installed, modified, or repaired prior to the effective date of this Contract. This coverage also does not include roofs </p><p><strong><b>Haul-Away</b></strong>: AHW will pay the cost to remove a covered appliance, system, or component when AHW is replacing a covered system, appliance or component </p><p><strong><b>Crane</b></strong>: AHW will cover the use of cranes or other lifting required for a covered service of a rooftop air conditioner or heating unit </p><p><strong><b>Code Violations</b></strong>: AHW will pay to correct code violations, if required to effect repair or replacement under this Contract  </p><p><strong><b>Permits</b></strong>: AHW will cover the cost of obtaining local building permits when required to commence repair or replacement of a covered item. AHW will not be responsible for replacement service if permits cannot be obtained </p><p><strong><b>Limits</b></strong>: The coverage for the No Fault Coverage Upgrade outlined above is limited to a $250 maximum in the aggregate per contract term for items related to the No Fault Coverage Upgrade.</p>\"}\r\n', '<span><a>No Fault Coverage</a>'),
