(149, 15, 'Septic System, Pumping & Sewage Ejector Pump', '', '100', '{\"title\":\"No Fault Coverage $60\",\"subtitle\":\"\",\"full_content\":\"<p>Covered: This coverage option provides coverage for failures due to mismatched systems, improper installations, code violations, crane costs, haul away service for systems or appliances that have failed, as set forth hereafter.</p><p><strong><b>Mismatched Systems</b></strong>: AHW will repair or replace a system or appliance that has failed due to a mismatch in capacity or efficiency provided the system is not undersized relative to the square footage of the area being cooled and/or heated </p><p><strong><b>Improper Installation</b></strong>: AHW will replace or repair a covered item that was improperly installed, modified, or repaired prior to the effective date of this Contract. This coverage also does not include roofs </p><p><strong><b>Haul-Away</b></strong>: AHW will pay the cost to remove a covered appliance, system, or component when AHW is replacing a covered system, appliance or component </p><p><strong><b>Crane</b></strong>: AHW will cover the use of cranes or other lifting required for a covered service of a rooftop air conditioner or heating unit </p><p><strong><b>Code Violations</b></strong>: AHW will pay to correct code violations, if required to effect repair or replacement under this Contract  </p><p><strong><b>Permits</b></strong>: AHW will cover the cost of obtaining local building permits when required to commence repair or replacement of a covered item. AHW will not be responsible for replacement service if permits cannot be obtained </p><p><strong><b>Limits</b></strong>: The coverage for the No Fault Coverage Upgrade outlined above is limited to a $250 maximum in the aggregate per contract term for items related to the No Fault Coverage Upgrade.</p>\"}\r\n', '<span><a>No Fault Coverage</a>'),
