(234, 20, 'Washer / Dryer', '0', '95', '{\"title\":\"Acclaimed Premium Coverage Upgrade $75\",\"subtitle\":\"(40 Additional Items included plans Premium, Premium +, Premium +1, & Ultimate)\",\"full_content\":\"<p>Covered: This coverage upgrade option provides coverage for the following items that are normally excluded from the Standard Coverage plan.</p><p><strong><b>Heating System</b></strong>: registers- disposable filters - grills - heat lamps </p><p><strong><b>Plumbing</b></strong>: angle stop and gate ball valves - toilet replacement with like kind and quality up to $400 per occurrence - interior hose bibs - shower heads - shower arms - faucets (replaced with chrome builder standard when necessary) </p><p><strong><b>Air Conditioner</b></strong>: Freon recovery, recapture and recharge up to $20 per lb. (not included in Tune Up service) - window units - registers </p><p><strong><b>Refrigerator</b></strong> (with purchase of coverage): Freon recovery, recapture and recharge - ice maker. In cases where parts are not available, our obligation is limited to cash in lieu based on replacement cost of the ice maker </p><p><strong><b>Dishwasher</b></strong>: rollers - baskets - racks - dials - door seals - hinges </p><p><strong><b>Water Heater</b></strong>: failures due to sediment </p><p><strong><b>Electrical</b></strong>: attic fans </p><p><strong><b>Trash Compactor</b></strong>: key assemblies - locks - removable bucket </p><p><strong><b>Garage Door Opener</b></strong>: springs - hinges - remote transmitter - keypad </p><p><strong><b>Oven/Range Cooktop</b></strong>: racks - clocks - rotisseries - knobs - dials - handles - interior lining </p><p><strong><b>Built in Microwave Oven</b></strong>: interior lining - shelves – clock</p>\"}', '<span><a>Premium Coverage Upgrade</a>'),
